function decryptHex(str) {
  if (!str || typeof str !== "string") return ""; // si es undefined o no es string, devuelvo vacío

  let hexString = str;
  let strOut = "";
  for (let x = 0; x < hexString.length; x += 2) {
    strOut += String.fromCharCode(parseInt(hexString.substr(x, 2), 16));
  }
  return strOut;
}


